import React from 'react';
import { Bar } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import faker from 'faker';

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
);
export const options = {
  responsive: true,
  plugins: {
    legend: {
      position: 'top',
    },
    title: {
      display: true,
      text: 'Chart.js Bar Chart',
    },
  },
};

const labels = ['January', 'February', 'March', 'April', 'May', 'June', 'July'];

export const data = {
  labels,
  datasets: [
    {
      label: 'none',
      data: faker.datatype
        .array()
        .map(() => faker.datatype.number({ min: 0, max: 1 })),
      backgroundColor: '#4A38AE',
    },
  ],
};

const DashboardTab = () => {
  console.log('');
  return (
    <div>
      <div>DashboardTab</div>
      <div>options</div>
      <div>
        {' '}
        <Bar options={options} data={data} />
      </div>
    </div>
  );
};

export default DashboardTab;
